import Form from "react-bootstrap/Form";
import React, { useState } from "react";
import Axios from "axios";

function GenerateReport() {
  const [reportId, setReportid] = useState("");
  const [doctorId, setDoctorid] = useState("");
  const [patientId, setPatientid] = useState("");
  const [reportone, setReportone] = useState("");
  const [reporttwo, setReporttwo] = useState("");
  cosnt [prescription, setPrescription] = useState("");
 

  const addToList = () => {
    Axios.post("http://localhost:5000/signup-doctor", {
      email: email,
      password: password,
      name: name,
      doctorid: doctorid,
      mobilenum: mobilenum,
      address: address,
      specialisation: specialisation,
      experience: experience,
    });
  };
  return (
    <div style={{ border: '2px solid gray', padding: '10px',margin:'40px 20px 20px 20px', borderRadius: '5px' }}>
    <h1 style={{ textAlign: "center",fontFamily:"sans-serif" , textDecoration: "underline"}}>Report Template-</h1><br/>
    <Form>
      <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
        <Form.Label style={{fontFamily:"sans-serif",fontSize:"20px"}}>ReportId-</Form.Label>
        <Form.Control type="text" style={{fontFamily:"sans-serif",fontSize:"20px"}}/>
      </Form.Group>
      <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
        <Form.Label style={{fontFamily:"sans-serif",fontSize:"20px"}}>DoctorId-</Form.Label>
        <Form.Control type="text" style={{fontFamily:"sans-serif",fontSize:"20px"}}/>
      </Form.Group>
      <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
        <Form.Label style={{fontFamily:"sans-serif",fontSize:"20px"}}>PatientId-</Form.Label>
        <Form.Control type="text" style={{fontFamily:"sans-serif",fontSize:"20px"}}/>
      </Form.Group>
      <Form.Group className="mb-3" controlId="exampleForm.ControlTextarea1">
        <Form.Label style={{fontFamily:"sans-serif",fontSize:"20px"}}>ReportOne-</Form.Label>
        <Form.Control as="textarea" rows={5} style={{fontFamily:"sans-serif",fontSize:"20px"}}/>
      </Form.Group>
      <Form.Group className="mb-3" controlId="exampleForm.ControlTextarea1">
        <Form.Label style={{fontFamily:"sans-serif",fontSize:"20px"}}>ReportTwo-</Form.Label>
        <Form.Control as="textarea" rows={5} style={{fontFamily:"sans-serif",fontSize:"20px"}}/>
      </Form.Group>
      <Form.Group className="mb-3" controlId="exampleForm.ControlTextarea1">
        <Form.Label style={{fontFamily:"sans-serif",fontSize:"20px"}}>Prescription-</Form.Label>
        <Form.Control as="textarea" rows={5} style={{fontFamily:"sans-serif",fontSize:"20px"}}/>
      </Form.Group>
    </Form>
    </div>
  );
}

export default GenerateReport;
